import MenuView from 'src/views/errors/NotFoundView';
import CompanyInfoView from 'src/views/menu/CompanyInfoView';


let element = [
  {
    path: "/",
    element: <Dashboard />,
    children: [
      {
        path: "messages",
        element: <DashboardMessages />,
      },
      { path: "tasks", element: <DashboardTasks /> },
    ],
  },
  { path: "team", element: <AboutPage /> },
];


const routes  = useRoutes(element);
export default element;



